import React, { useState, useEffect } from "react";
import axios from "axios";

const NamaDokter = ({ onDataReceived }) => {
  useEffect(() => {
    fetchNamaDokter();
  }, []);

  const fetchNamaDokter = async () => {
    try {
      const response = await axios.get(
        `${API_URL}/ralan/poliklinik/dokter/nama`
      );
      const dataOptionDokter = response.data.map((item) => ({
        value: item.id,
        label: item.nama_dokter,
      }));
      onDataReceived(dataOptionDokter); // Meneruskan data namaDokter ke halaman lain
    } catch (error) {
      console.log(error);
    }
  };
};

export default NamaDokter;
